  false,\n\t\"url\": null,\n\t\"notes\": \"nThe Barnes Ice Cap data set contains survey
  measurements of a network of 43 stakes along a 10 km flow line on the northeast
  flank of the south dome of the Barnes Ice Cap. The measurements are of mass balance,
  surface velocity, and surface elevation.  They were taken over a period of time
  from 1970 to 1984.The data set came from a hard copy computer printout containing
  raw data as well as processed quantities.  This printout was scanned and digitized
  into a PDF file. This PDF file was put through Optical Character Recognition (OCR)
  software and saved as another PDF file.  The resultant PDF file is human readable
  and all values are correct when viewed in an Adobe PDF reader. However, if you copy
  the contents and paste them into another application there may be errors in the
  values as the OCR process did not accurately compute all characters correctly. If
  you copy the data values into another application for analysis, double check the
  values against what is in the PDF file. The data are available via FTP.n\",\n\t\"license_title\":
